 OBJROOT, PROJECT_NAME) not set\", to: &stdErrStream)\n   exit(1)\n}\nlet packageURL = srcRoot.appendingPathComponent(\"Package.swift\")\nlet packageDir = srcRoot.appendingPathComponent(\"Packages\")\nlet symlinksURL = srcRoot.appendingPathComponent(\"Packages\").appendingPathComponent(\"symlinks\")\n\n// STEP 1: if the `Package.swift` file doesn't exist, create it.\n// For anything *except* a CwlViews project, you'll need to customize this before it is useful.\nprint(\"### Testing existence of \\(packageURL.path)\", to: &stdErrStream)\nif !FileManager.default.fileExists(atPath: packageURL.path) {\n    let defaultPackageManifest = \"\"\"\n        // swift-tools-version:4.0\\n\n        import PackageDescription\\n\\n\n        let package = Package(\\n\n            name: \\\"\\(projectName)\\\",\\n\n            dependencies: [\n                .package(url: \\\"https://github.com/mattgallagher/CwlViews.git\\\", from: \\\"0.1.0\\\")\n            ]\\n\n        )\\n\n        \"\"\"\n    if let _ = try? defaultPackageManifest.write(to: packageURL, atomically: true, encoding: .utf8) {\n        print(\"Wrote default Package.swift file to \\(packageURL.path)\", to: &stdErrStream)\n    } else {\n        print(\"error: Unable to write manifest file.\", to: &stdErrStream)\n        exit(1)\n    }\n}\n\n// Utility for steps 2 and 3: Launch a process and run to completion, returning the standard out on success.\nfunc launch(_ command: String, _ arguments: [String], directory: URL? = nil) -> String? {\n    let proc = Process()\n    proc.launchPath = command\n    proc.arguments = arguments\n    _ = directory.map { proc.currentDirectoryPath = $0.path }\n    let pipe = Pipe()\n    proc.standardOutput = pipe\n    proc.launch()\n    let result = String(data: pipe.fileHandleForReading.readDataToEndOfFile(), encoding: .utf8) ?? \"\"\n    proc.waitUntilExit()\n    return proc.terminationStatus != 0 ? nil : result\n}\n\n// STEP 2: use `swift package update` to get all dependencies\nprint(\"